import React from 'react'

export default function Contact() {
  return (
    <div>
      <h1>Contact</h1>
      <h3>If you want to reserve a table in our restaurant, contact us and we will attend you quickly, with our 24/7 chat service.</h3>
      <div>
        <h4><label>Enter Name : </label> <input type='text' placeholder='Enter your name'/></h4>
        
        <h4><label>Enter Email : </label> <input type='email' placeholder='abvc123#|@gmail.com'/></h4>
      </div>

    </div>
  )
}
